import React from "react";
import {NavLink,withRouter} from 'react-router-dom';

import { ReactComponent as Logo} from "../../assets/trading.png";
import { ReactComponent as Home} from "../../assets/coin.png";
// import { ReactComponent as Explore} from "../../assets/internet-explorer.png";

import './header.css'

const Header=()=>{
    return (
        <nav>
            <div className='div-header'>
                <div className='div-icon'>
                    <Logo/>
                </div>
                <div style={{display:'flex',flexDirection:'row'}}>
                    <NavLink className='div-icon' to='/'><Home/></NavLink>
                    {/* <NavLink className='div-icon' to='/explore'><Explore/></NavLink> */}
                    <button className='button-header'>Log out</button>
                </div>
            </div>

        </nav>
    );
}

export default withRouter(Header);
